import './App.css';
import React, { useRef, useState, Suspense } from 'react'
import { Canvas, useFrame } from '@react-three/fiber'
import { softShadows, OrbitControls, useGLTF, PerspectiveCamera, CameraShake, MeshReflectorMaterial  } from '@react-three/drei'
import { EffectComposer, DepthOfField, Bloom, Noise, Vignette } from '@react-three/postprocessing'
import { useSpring, a } from '@react-spring/three';


const Header = () =>{
  return (
      <header>
          <div className='logo'>
          <svg id="Layer_1" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 931.96 200.4">
    <title>nabla</title><g fill="#fc121d">
    <path
        d="M934.47,183.13,882,15a16.11,16.11,0,0,0-15.37-11.3H795.42a16.11,16.11,0,0,0-15.25,11l-45.6,134.78A17.11,17.11,0,0,1,718.37,161H688.92a16.1,16.1,0,0,1-16.1-16.1V19.72a16.1,16.1,0,0,0-16.1-16.1H607.15a16.09,16.09,0,0,0-16.09,16.1v97.92a4.21,4.21,0,0,1-7.52,2.6,52.1,52.1,0,0,0-11.84-10.73,15.82,15.82,0,0,1-3.44-23.46c7.47-8.77,9.92-21.21,9-35.87-1.63-26.82-23.54-46.54-52.38-46.54H408.38a16.1,16.1,0,0,0-16.1,16.1V125.3a4.2,4.2,0,0,1-8.22,1.25L349.2,15a16.1,16.1,0,0,0-15.36-11.3H262.68a16.11,16.11,0,0,0-15.25,11L206.66,135.38a4.21,4.21,0,0,1-8.2-1.34V19.74a16.1,16.1,0,0,0-16.1-16.1H172a16.1,16.1,0,0,0-16.1,16.1V62c0,15.69-20.15,22.11-29.23,9.32L83.43,10.43A16.1,16.1,0,0,0,70.3,3.64H19.35a16.1,16.1,0,0,0-16.1,16.1V187.91A16.09,16.09,0,0,0,19.35,204H29.77a16.09,16.09,0,0,0,16.09-16.09V143.83c0-15.61,20-22.08,29.14-9.44l45.58,63a16.1,16.1,0,0,0,13,6.65h48.74l23.55,0H223a16.09,16.09,0,0,0,15.49-11.74l6.82-24.22,7.46-25.3,9.88-34.4c4.55-15.86,27.18-15.42,31.1.61L302,142.77l6.12,25.3,5.79,23.68A16.1,16.1,0,0,0,329.55,204h56.81l22,0H532.17c21,0,39.3-6.62,49.72-11.37a8.91,8.91,0,0,1,11.37,3.42,16.09,16.09,0,0,0,13.9,8H755.7a16.11,16.11,0,0,0,15.5-11.74L778,168.07l7.46-25.3,9.88-34.4c4.55-15.86,27.18-15.42,31.1.61l8.29,33.79,6.12,25.3,5.79,23.68A16.1,16.1,0,0,0,862.29,204h56.82A16.1,16.1,0,0,0,934.47,183.13ZM474,50.86a16.1,16.1,0,0,1,16.1-16.1h1.75c13.31,0,24.5,3.2,24.5,27.17,0,23.43-14.12,27.69-24.5,27.69h-1.75A16.09,16.09,0,0,1,474,73.53Zm21,121.32h-4.94a16.1,16.1,0,0,1-16.1-16.1V130.76a16.1,16.1,0,0,1,16.1-16.1h4.94c12,0,22.64,7.72,22.64,28.49C517.72,165,507.87,172.18,495.08,172.18Z"
        transform="translate(-3.25 -3.62)"
    /></g>
</svg>
          </div>
      </header>
  );
};

softShadows();

function Sand(props) {
  const group = useRef()
  const { nodes, materials } = useGLTF('Canvas_Sand.glb')
  return (
    <group ref={group} {...props} dispose={null}>
      <group position={[-496.54, 0, -6000]} rotation={[-Math.PI, 0, -Math.PI]}>
        <mesh geometry={nodes.Landscape3_1.geometry} material={nodes.Landscape3_1.material} />
      </group>
      <mesh geometry={nodes.Landscape1.geometry} material={nodes.Landscape1.material} position={[318.05, 0, 0]} />
    </group>
  )
}


function CD(props) {
  const group = useRef()

  const [hovered, setHovered] = useState(false);
  const { nodes, materials } = useGLTF('Canvas_CD.glb')

  useFrame(() => {
    group.current.rotation.y += 0.02;
   });

  return (
    <group ref={group} {...props} dispose={null}>
      <group position={[0, 800, -4000]} rotation={[0, 700, 0]}>
        <group position={[0.47, -57.27, -3.71]} scale={1.5}>
          <mesh geometry={nodes.Sphere2.geometry} material={nodes.Sphere2.material} position={[5.28, 57.74, -265.23]} />
          <mesh geometry={nodes.Sphere1.geometry} material={nodes.Sphere1.material} position={[306.5, 57.74, 134.46]} />
          <mesh geometry={nodes.Sphere.geometry} material={nodes.Sphere.material} position={[-296.7, 57.74, 134.46]} />
        </group>
      </group>
    </group>
  )
}


function App() {
  return (
    <>
    <Header />
    <Canvas colorManagement >
      <PerspectiveCamera makeDefault position={[700,1200,-7000]} far={800000} fov={60} rotation={[Math.PI, Math.PI, 0]} />
      <gridHelper />
      <fog attach="fog" args={['#848484', 4000, 400]} />
      <ambientLight intensity={0.3} />
      <directionalLight  intensity={0.3} color="white" position={[0, 6000, 5]} />
      <Suspense fallback={null}>
        <Sand />
        <CD />
      </Suspense>
      <EffectComposer>
        <DepthOfField focusDistance={10} focalLength={0.2} bokehScale={2} height={480} />
        <Noise opacity={.033} />
        <Vignette eskil={false} offset={0.1} darkness={0.1} />
      </EffectComposer>
      <OrbitControls />
    </Canvas>
    </>
  );
}

export default App;
